        axios.get('https://data.121.com.cn/szmbdata/open/openData.do?type=""&appid=""&appKey="8d3f601b-efcc"&parameter=""')
        .then((res) => {
            console.log(res)
        })
        return (
            <div>
                {/* 给容器组件传递store */}
                <Count store={store}/>
            </div>
        )
    }
}
